import { applyFlex } from 'Helper/utils';
import styled from 'styled-components';

export const StyledScreenBoard = styled.div`
  width: 580px;
  border: 1px solid red;
  ${({ flex }) => applyFlex(flex)};
  flex-wrap: wrap;
`;
